import java.util.Scanner;public class Main {public static void main (String args[]){    Scanner scan=new Scanner(System.in);    int n=scan.nextInt();    String[] arr = new String[n];    int temp=n;    scan.nextLine();    int j=0;    while(n--!=0){        String s = scan.nextLine();        arr[j]=s;        j++;    }    int c=0,m=0,index=-1;    int k=0;    while(temp--!=0){        if(arr[k].equals(arr[0])){            c++;        }else{            index = k;            m++;        }        k++;    }    if(c>m){        System.out.print(arr[0]);    }else{        System.out.print(arr[index]);    }    }}
